import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

interface ProductCard {
  id: string;
  name: string;
  description: string;
  color: string;
  path: string;
}

const ProductSelection: React.FC = () => {
  const navigate = useNavigate();

  const productCards: ProductCard[] = [
    {
      id: 'case',
      name: '主機外殼',
      description: '設計創新的電腦主機外殼',
      color: 'from-amber-500 to-amber-700',
      path: '/case'
    },
    {
      id: 'cooler',
      name: '散熱器',
      description: '打造高效能與美觀的散熱解決方案',
      color: 'from-sky-400 to-blue-600',
      path: '/cooler'
    },
    {
      id: 'psu',
      name: '電源供應器',
      description: '設計可靠與高效的電源模組',
      color: 'from-indigo-500 to-purple-700',
      path: '/psu'
    },
    {
      id: 'furniture',
      name: '遊戲家具',
      description: '創造舒適與人體工學的遊戲空間',
      color: 'from-rose-400 to-rose-600',
      path: '/furniture'
    },
  ];

  const handleSelectProduct = (path: string) => {
    navigate(path);
  };

  return (
    <div className="bg-[#1a1a1a] min-h-screen py-12">
      <div className="container mx-auto px-4">
        {/* Hero Section */}
        <div className="mb-16 text-center">
          <h2 className="text-gray-400 text-xl mb-2">不要只接受平凡的設計。</h2>
          <div className="flex flex-col md:flex-row items-center justify-center">
            <h1 className="text-5xl md:text-6xl font-bold mr-2 text-white">創造</h1>
            <h1 className="text-5xl md:text-6xl font-serif italic text-purple-500">非凡。</h1>
          </div>
        </div>

        {/* Subscription Banner */}
        <div className="cm-gradient rounded-lg py-10 px-6 mb-16 flex flex-col md:flex-row justify-between items-center">
          <div className="text-white mb-6 md:mb-0">
            <h2 className="text-3xl font-bold mb-2">BE THE FIRST TO KNOW</h2>
            <p>加入我們的郵件列表，取得最新設計靈感和特殊優惠。</p>
          </div>
          <div className="flex w-full md:w-auto">
            <input
              type="email"
              placeholder="您的電子郵件"
              className="px-4 py-2 rounded-l-md w-full md:w-64"
            />
            <button className="bg-[#7928ca] text-white px-6 py-2 rounded-r-md hover:bg-[#6922b6]">
              訂閱
            </button>
          </div>
        </div>

        {/* Product Cards */}
        <h2 className="text-2xl font-bold text-white mb-8">選擇產品類型</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-16">
          {productCards.map((product) => (
            <div 
              key={product.id} 
              className="cm-product-card cursor-pointer overflow-hidden"
              onClick={() => handleSelectProduct(product.path)}
            >
              <div className={`bg-gradient-to-br ${product.color} h-32 flex items-center justify-center`}>
                <h3 className="text-2xl font-bold text-white">{product.name}</h3>
              </div>
              <div className="p-6">
                <p className="text-gray-700 mb-4">{product.description}</p>
                <button className="text-purple-600 font-semibold flex items-center">
                  開始設計
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 ml-2" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M10.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L12.586 11H5a1 1 0 110-2h7.586l-2.293-2.293a1 1 0 010-1.414z" clipRule="evenodd" />
                  </svg>
                </button>
              </div>
            </div>
          ))}
        </div>

        <div className="text-center mt-16 text-gray-400">
          <p>由 Cooler Master AI 設計平台支援 © 2023</p>
        </div>
      </div>
    </div>
  );
};

export default ProductSelection;
